import { connect } from "react-redux"




const LeaderBoard = ({ users ,  usersValue }) => {
    console.log("LeaderBoard props ", users)




      return (
        <div id="customers">
            <h3 className="center">Leaderboard</h3>
            <table>
            <thead>
                <tr>
                <th>Name</th>
                <th>Answer</th>
                <th>Poll</th>
                </tr>
            </thead>
            <tbody>
                {users.map(user => (
                <tr key={user.id}> 
                    <td><img src={user.avatarURL} 
                    alt={`Avar of ${user.name}`}
                     className="avatar" /> 
                     {user.name}</td>
                     <td>{user.answers.length}</td>

                </tr>
                ))}
            </tbody>
            </table>
        </div>
      );
}
const mapStateToProps = ({ users }) => {

    return {
        usersOne : users,
        users : Object.values(users).sort((a,b) => 
             Object.values(b.answers).length - Object.values(a.answers).length),
        usersValue : Object.values(users)
    }
}

export default connect(mapStateToProps)(LeaderBoard)
